import { Component } from '@angular/core';

@Component({
  selector: 'dip3',
  templateUrl: './dip3.component.html',
  styleUrls: ['./dip3.component.css']
})
export class Dip3Component {
  coral ={
    name:'jay',
    lname :'swami',
    city :'narayan',
    height: 10,
    lessdis:2.39,
    inStock1:11
  }

}
<div>
    <h3> {{coral.name}} </h3>
    <h3> {{coral.lname}} </h3>
    <h3> {{coral.city}} </h3>
    <h3> {{coral.height}} </h3>
    <h3> {{coral.inStock1}} </h3>
</div>
